import './App.css';

function Game4(){
    return(
        <>
            <Board />
        </>
    );
}

function Board(){
    return(
        [0,3,6].map((start) => (
            <div className='board-row'>
                {Array(3).fill(null).map((_, index) => (
                    <Square value={start+index}/>
                ))}
            </div>
        ))
    );
}

function Square({value}){
    return(
        <div className='square'>
            {value}
        </div>
    );
}

export default Game4;
